import React from 'react';
import { Toolbar, Typography } from '@mui/material';
import { NavLink } from 'react-router-dom';

import logo from '../../images/skiing.png';
import './Header.css'

export default function Header() {

   return (
      <Toolbar className='main-nav'>
         <span>
            <NavLink className='main-navlink' to='/'>
               <img className='logo'
                  src={logo}
               />
            </NavLink>
            <Typography sx={{ display: 'inline' }} variant='h3' className='title'>Ski California</Typography>
         </span>
         <span>

            <NavLink className='main-navlink' to='/about'>About</NavLink>
            <NavLink className='main-navlink' to='/resorts'>Resorts</NavLink>
         </span>
      </Toolbar>
   );
}
